export const FETCH_DOGS = 'FETCH_DOGS'

export function fetchDogs() {
    return function(dispatch) {
        axios.get("http://localhost:3001/api/dogs")
        .then((dogs) => {
            dispatch({
                type: FETCH_DOGS,
                payload: dogs
            })
        })
    }
}
